import { useState } from 'react';
import Card from './shared/Card';

function Feedbackitem({ item }) {
  return (
    <div className='card'>
      <div className='num-display'>{item.rating}</div>
      <div className='text-display'>{item.text}</div>
    </div>
  );
}

export default Feedbackitem;
